import React, {useState, useEffect} from 'react';
import Lista from './Lista';

function ListaApp() {

    const [lomake, setLomake] = useState({nimi: '', kayttaja: '', kaupunki: ''});

    const fetchUrl = async () => {
      try {
          const response = await fetch('https://jsonplaceholder.typicode.com/users/5');
          const json = await response.json();

          setLomake({ nimi: json.name, kayttaja: json.username, kaupunki: json.address.city})  

      } catch (error) {
          console.log(error);
      } 
    }

    useEffect( () => { fetchUrl() }, []);

    console.log(lomake);

  return (
    <div>
        <Lista lomake = { lomake } />
    </div>
);
}

export default ListaApp;
